const data = 
    {
        "site": {
            "site_code": 101,
            "siteName": "Hanoi",
            "byShip": 500,
            "byAir": 300,
            "otherInfo": "Main warehouse"
        },
        "inventory": {
            "inventory_id": 2001,
            "merchandiseCode": 1,
            "inStockQuantity": 300,
            "unit": "piece",
            "siteCode": 101
        }
    }
console.log(data);
const SiteInventoryItem = (SiteInventoryItem) => {
    SiteInventoryItem = data;
   return(
    <table>
    <thead>
        <tr>
            <th>Site Code</th>
            <th>Site Name</th>
            <th>By Ship</th>
            <th>By Air</th>
            <th>Other Info</th>
        </tr>
    </thead>
    <tbody>
        <tr>
            <td>{SiteInventoryItem.site.site_code}</td>
            <td>{SiteInventoryItem.site.siteName}</td>
            <td>{SiteInventoryItem.site.byShip}</td>
            <td>{SiteInventoryItem.site.byAir}</td>
            <td>{SiteInventoryItem.site.otherInfo}</td>
        </tr>
    </tbody>
    </table>
   )

}
export default SiteInventoryItem;
